import React from "react";
import { Jumbotron, Container } from "reactstrap";
import styled from "styled-components";

const Padding = styled.div`
  width: 80%;
  margin: 2% auto;
`;

const BodyComp = props => {
  return (
    <Padding>
      <Jumbotron fluid>
        <Container fluid>
          <h1 className="display-3">Chill, it's just an App</h1>
          <p className="lead">
            Are you having a strong REACTion to how awesome this app is,
            considering the builder though a library was just that really cool
            place with all of the books two weeks ago? I don't blame you but you
            have to chill, it's just an app!
          </p>
        </Container>
      </Jumbotron>
    </Padding>
  );
};

export default BodyComp;
